        link.download = "Original-Logs-H-D-M-Y-" + currentHour + "-" + currentDay + "-" + currentMonth + "-" + currentYear +".json";
          
   
        document.body.appendChild(link); // Initialize link
          
   
        link.click(); // Force click
  
        document.body.removeChild(link); // Remove link

